sources.styles/utils/_mixins.scss:
@mixin hover($_property, $_toValue) {
  transition: #{$_property} 0.3s;

  &:hover {
    #{$_property}: $_toValue;
  }
}

@mixin onDesktop {
  @media(min-width: 1024px) {
    @content;
  }
}

@mixin onTablet {
  @media(min-width: 768px){
    @content;
  }
}

@mixin linkStyle {
    font-family: Helvetica, sans-serif;
    font-weight: 300;
    font-size: 14px;
    line-height: 17px;
    color: #4F4F4F;
    text-decoration: none;
    text-transform: uppercase;
    padding: 13px 25px;
}

